function RemoveVarified(n){$(`table#unverified-entries-table tr#unverified-entries-row-${n}`).remove();var t=parseInt($(".unverified-entries-count").html())-1;$(".unverified-entries-count").html(t)}function VerifyJournalEntry(n){n!=null&&sweetAlert.confirm({showCancelButton:!0},function(t){t&&$.ajax({url:`/Journal/VerifyJournalEntry/${n}`,type:"GET",success:function(t){var i=t;console.log("response",i);i.responseCode==CODES.RESPONSE_CODE_OK?(sweetAlert.success({title:"Success!",text:i.responseMessage}),RemoveVarified(n)):i.errorCode==CODES.RESPONSE_CODE_ERROR?sweetAlert.error({text:i.errorMessage}):i.responseCode==CODES.RESPONSE_CODE_NOTFOUND&&sweetAlert.error({text:i.responseMessage})},error:function(n){console.log(n);sweetAlert.error({text:"An error Occured while verifying journal Entry."})}})})}